		this.addEventListener("tick", fl_TickToPrestige.bind(this));
		
		function fl_TickToPrestige() {
			if (PrestigeFixedNumberHoldOverPressOut == 1) {
				if (this.Menu_Fixed_Screen.prestige.currentFrame < 10) {
					this.Menu_Fixed_Screen.prestige.play()
				}
			}
			if (PrestigeFixedNumberHoldOverPressOut == 0) {
				if (this.Menu_Fixed_Screen.prestige.currentFrame > 10 && this.Menu_Fixed_Screen.prestige.currentFrame < 20) {
					this.Menu_Fixed_Screen.prestige.gotoAndPlay(40)
				}
			}
			if (PrestigeFixedNumberHoldOverPressOut == 2) {
				if (this.Menu_Fixed_Screen.prestige.currentFrame < 20) {
					PickaxeAutoTier = 0
					PickaxeIdleNextUnThisAutoSafe = 1
					ore_block_value = 1
					this.Menu_Fixed_Screen.prestige.gotoAndPlay(20)
					ore_block_last_value = 1
					upgrades_text_value = 0
					SavedPrestige = 0
					upgrades_auto_text_value = -1
					prestigedmoney_value = moneyore_prestige_value
					powerore_prestiged_value = powerore_prestige_value
					money_text_value = 0
					damage_value = 10
					this.Menu_Fixed_Screen.pikachu.gotoAndPlay(0)
					this.Menu_Fixed_Screen.pikachu.pickaxe.gotoAndStop(0)
					PickaxeTier = 1
					PickaxeActiveNextUnThisPikachu = 1
					pickaxe_text_value = "Wooden"
					auto_damage_value = 10
					sold_text = "100"
					auto_sold_text = "50"
					high_prestige_value *= 3
					antiprestige_value *= 3
					ore_text_value = "Paper"
					//trace("Never Restart To Prestige Get Everything")
					infinity_money_text_value = 0
					//SoundMixer.stopAll()
					auto_pickaxe_text_value = "Gone"
					if (this.Menu_Fixed_Screen.back_button.currentFrame == 30) {
		
					} else {
						this.Menu_Fixed_Screen.back_button.gotoAndPlay(112)
					}
					if (this.Menu_Fixed_Screen.next_button.currentFrame == 30) {
		
					} else {
						this.Menu_Fixed_Screen.next_button.gotoAndPlay(112)
					}
					WaitPickaxePikachu = true
					health_text_value = 100
					this.Menu_Fixed_Screen.auto_safe.gotoAndStop(0)
					this.Menu_Fixed_Screen.auto_safe.afasgdgsdg.gotoAndStop(0)
					this.Menu_Fixed_Screen.ore_blocks.ore_anim.gotoAndStop(0)
					high_money_text_value = 0
					this.Menu_Fixed_Screen.auto_safe.afasgdgsdg.pickaxe_auto.gotoAndStop(0)
					this.Menu_Fixed_Screen.groundfade.gotoAndStop(0)
					this.Menu_Fixed_Screen.bsdfge.steewat.gotoAndStop(0)
				}
			}
		
			var PrestigeTierGameFixedHittest = stage.localToLocal(stage.mouseX / 1.45, stage.mouseY / 1.45, this.Menu_Fixed_Screen.prestige)
		
			if (this.Menu_Fixed_Screen.prestige.hitTest(PrestigeTierGameFixedHittest.x, PrestigeTierGameFixedHittest.y)) {
				PrestigeFixedNumberHoldOverPressOut = 1
			} else {
				PrestigeFixedNumberHoldOverPressOut = 0
			}
		}
		
